COORDS = dict(zip(
    zip(
    (0, -1, 0, 1, -2, -1, 0, 1, 2, -1,  0,  1,  0),
    (2,  1, 1, 1,  0,  0, 0, 0, 0, -1, -1, -1, -2)),
    (char for char in """
    1
  2 3 4
5 6 7 8 9
  A B C
    D""" if char not in (" \n"))))

DIRS = {"U" : (0, 1), "R" : (1,0),
        "D" : (0,-1), "L" : (-1, 0)}

class Point:
    def __init__(self, x, y):
        self.x, self.y = x, y
    
    def __add__(self, other):
        return Point(self.x + other.x, self.y + other.y)
    
    def __repr__(self):
        return f"Pt(x={self.x}, y={self.y}"
    
    def as_tuple(self):
        return self.x, self.y

def move_if_able(src, dst, locs):
    to = src + dst
    if to.as_tuple() in locs:
        return to
    else:
        return src

def p2p2(problem_input):
    cur = Point(-2, 0)
    answer = []
    for line in problem_input:
        for dir in line:
            cur = move_if_able(cur, Point(*DIRS[dir]), COORDS.keys())
        answer.append(COORDS[cur.as_tuple()])
    return answer

PROBLEM = """



"""

print(p2p2(PROBLEM.splitlines()))
